http://www.amazon.com/Aztec-Inca-Maya-Eyewitness-Books/dp/0756673208&lt;/a&gt;

Eyewitness: Aztec, Inca &amp; Maya is a spectacular and informative guide to the rise and fall of the pre-Columbian cultures of the Aztecs, Incas, and Mayas, who built vast empires and left behind a legacy of mystery and wonder. Amazing color photographs offer children a unique &quot;eyewitness&quot; view of these incredible civilizations. Full-color photos. Unravel the remarkable mysteries of the ancient peoples who built great palaces and pyramids, and developed an accurate calendar and a knowledge of astronomy without the benefit of telescopes or written language.
